import './VideoContainer.css'
const VideoContainer = (video) => {
    return ( 
       <div class="video-container">
           <div className="video-side">
               <source>
           <video src={video} autoPlay muted loop>
           </video></source>
           </div>
       </div>
     );
}
 
export default VideoContainer;
